@lg_oledart housed  the works of the contemporary figurative sculptor @barryxballstudio at @friezeofficial. Displayed in the center of the gallery was Ball’s golden sculpture titled: “Perfect Forms” inspired after Umberto Boccioni’s (1882-1916) “Unique Forms of Continuity in Space,” 1913.

Boarding the space was the the metal sculpture series consisting of four variations: “Granulo-Specular Chiaroscuro Meta-Morph” (Alchemic Black Steel, Alchemic Gold, Alchemic Silver, Alchemic Copper). These are the first NFT artworks created by @barryxballstudio and are exhibited on @lg_oledart screens. 

